import React from 'react';
import './feed.css';
import ImageCard from './ImageCard/ImageCard';
import { Link } from 'react-router-dom';

const Feed = (props) => {
  const imgs = props.foundImages;

  return (
    <React.Fragment>
      <h2>Found Images: {props.foundImages.length}</h2>
      <div className="image-list">
        {imgs.map((img) => {
          return 3;
        })}
      </div>
    </React.Fragment>
  );
};

export default Feed;
